import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Input from "./Input";
import AddIcon from '@mui/icons-material/Add';

function App() {
  return (
    <div>
      <Header />
      <Input />
      <div className="note-container">
        <div className="note">
          <div>
            <h3>NOte title</h3>
            <p>Note content</p>
          </div>
          <button>
            <AddIcon />
          </button>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default App;
